export const getIndex = function (arr:any[],index: number,hasCurrent?:boolean,props?:headerProps){
    if (arr[index]){
        return arr[index](props)
    }else {
        if (hasCurrent){
            return arr[0](props)
        }else {
            return  ''
        }
    }
}

export const BodySlot = (props: headerProps) => {
    const ListData = [body_shirt, body_coffee, body_device,body_dress]
    return (
        <>
            {getIndex(ListData,props.index,true,props)}
        </>
    );
};
